import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import grey from '@material-ui/core/colors/grey';

export default makeStyles((theme: Theme) =>
  createStyles({
    root: {
      padding: theme.spacing(4),
    },
    paper: {
      padding: theme.spacing(5),
    },
    panelDetails: {
      paddingLeft: '40px',
    },
    oddPanelDetail: {
      background: grey[200],
    },
    input: {
      width: '100%',
    },
  })
);
